/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<${scopeTag("ui5-popover", tags, suffix)} class="ui5-notification-overflow-popover" placement-type="Bottom" horizontal-align="Right" hide-arrow><div class="ui5-notification-overflow-list">${ repeat(context.overflowActions, (item, index) => item._id || index, (item, index) => block1(item, index, context, tags, suffix)) }</div></${scopeTag("ui5-popover", tags, suffix)}>`;
const block1 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-button", tags, suffix)} icon="${ifDefined(item.icon)}" design="Transparent" @click="${item.press}" ?disabled="${item.disabled}" design="${ifDefined(item.design)}" data-ui5-external-action-item-id="${ifDefined(item.refItemid)}">${ifDefined(item.text)}</${scopeTag("ui5-button", tags, suffix)}>`;


export default block0;
